webpackJsonp([0x6c53e2a57c8e],{646:function(e,n){e.exports={data:{markdownRemark:{html:"<p>In the silt of Mullica River<br>\nOn a dark and stormy eve<br>\nMother Leeds' haunches quiver<br>\nShe sops her sweet with her sleeve  </p>\n<p>Though, she's aint a Rook to birthin' babies<br>\nHaving twelve within her brood<br>\nStill she called all the local ladies<br>\nTo do their dance and set the mood  </p>\n<p><em>Siren voice is screaming</em><br>\n<em>Cloven tail, hoof, and horn</em><br>\n<em>All the midwives weeping</em><br>\n<em>The Leeds Devils just been born</em>  </p>\n<p>They all gathered in a circle<br>\nSmiled at the newborn in the room<br>\nBut then their blood began to curdle<br>\nAs his mangled legs grew and grew  </p>\n<p>The boy, they all had just been holding<br>\nNow had a goats head and some claws<br>\nHis eyes where red and they are bulging<br>\nHis wingspan tore up all the gauze  </p>\n<p><em>Siren voice is screaming</em><br>\n<em>Cloven tail, hoof, and horn</em><br>\n<em>All the midwives weeping</em><br>\n<em>The Leeds Devils just been born</em>  </p>\n<p>Thrashing all about the cabin<br>\nHe took his mothers fragile soul<br>\nThrough the chimney wings where flapping<br>\nKnocking down the lightning pole  </p>\n<p>To this day if you wander<br>\nTo far within the piney trees<br>\nBeware of shadows moving yonder<br>\nPray it aint the likes of Leeds  </p>\n<p><em>Siren voice is screaming</em><br>\n<em>Cloven tail, hoof, and horn</em><br>\n<em>All the midwives weeping</em><br>\n<em>The Leeds Devils just been born</em>  </p>\n<h2>Chords</h2>\n<pre><code>Em G C\n</code></pre>",frontmatter:{title:"Leeds Devil"},fields:{date:null}}},pathContext:{slug:"/songs/leeds-devil/"}}}});
